import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import logo from './logo.svg';
import '././bootstrap/bootstrap.css';



class FirstDiv extends Component {

  fillthenumbers = {
    firstnum: 1
  }
  render(){
    //setup an array of random Welcome Messages
    //or random Welcome message translations from English to Spanish
    //Spoken as well
    //Google api maybe?
    return(
      <div className="FirstDiv">

        <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <a className="navbar-brand" href="#">TheSenseGuy</a>
          <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav">
              <li className="nav-item active">
                <a className="nav-link" href="#">Contact Me   <span class="sr-only">(current)</span></a>
              </li>
            </ul>
          </div>
        </nav>

        <div className="container-fluid bg-light">
          <div className="row">
            <div className="col-md-6 mx-auto">
              <h1><b>Thank you</b> for EMBED A COLAB CODE Visiting my Resume

              </h1>
              <h4 className="text-center">As a current Computer Science student, I have gained the skills and confidence to further develop my career and begin applying solutions to
real world problems. For example, this site I made it with the use of bootStrap and React Framework. Although I'm frankly not the best UI Designer, you may find I try
 to enhance my skills by doing. Furthermore, I am seeking an opportunity to fit in a company's work model and ethics, by excelling in completing goals, achieving expertise in the field, hence bringing value to the company, customers and business partners.</h4>
            </div>
            <div className="col-md-6 mx-auto">
              <h3><b>You are</b> visitor number {this.fillthenumbers.firstnum}</h3>
            </div>
          </div>

          <div className="row bg-secondary ">
            <p className="text-center text-white font-effect-3d">The below Chart shows since I began my IT experience in 2007</p>
          </div>



        </div>

      </div>

    )

  }

}





